{
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://anypoint.mulesoft.com/apiplatform/repository/public/organizations/3207/apis/4514/versions/4525/files/guide.json#",
  "type": "object",
  "properties": {
    "guideId": { "type": "string" },
    "productId": { "type": "string" },
    "steps": {
      "type": "array",
      "items": { "$ref": "#/step" }
    },
    "complete": { "$ref": "#/complete" }
  },
  "additionalProperties": false,
  "required": [ "guideId", "productId", "steps", "complete" ],

  "definitions": {

    "step": {
      "description": "A step in the guide",
      "type": "object",
      "id": "#/step",
      "properties": {
        "type": { "type": "string", "enum": [ "step" ] },
        "order": { "type": "integer" },
        "header": { "type": "string" },
        "steps": {
          "type": "array",
          "minItems": 1,
          "items": { "$ref": "#/step" }
        },
        "content": { "$ref": "#/content" }
      },
      "additionalProperties": false,
      "required": [ "type", "order", "header" ]
    },

    "complete": {
      "description": "Content displayed when the guide is completed",
      "type": "object",
      "id": "#/complete",
      "properties": {
        "type": { "type": "string", "enum": [ "complete" ] },
        "header": { "type": "string" },
        "content": { "$ref": "#/content" }
      },
      "additionalProperties": false,
      "required": [ "type", "header", "content" ]
    },

   "content": {
      "description": "An array with content",
      "id": "#/content",
      "type": "array",
      "items": { "anyOf": [
          { "$ref": "#/text" },
          { "$ref": "#/info" },
          { "$ref": "#/nav" },
          { "$ref": "#/list" },
          { "$ref": "#/image" },
          { "$ref": "#/break" },
          { "$ref": "#/sms" },
          { "$ref": "#/call" },
          { "$ref": "#/contacts" }
        ]
      }
    },

    "text": {
      "description": "Text content",
      "type": "object",
      "id": "#/text",
      "properties": {
        "type": { "type": "string", "enum": [ "text" ] },
        "text": { "type": "string" }
      },
      "additionalProperties": false,
      "required": [ "type", "text" ]
    },

    "info": {
      "description": "Info text with icon and optional href",
      "type": "object",
      "id": "#/info",
      "properties": {
        "type": { "type": "string", "enum": [ "info" ] },
        "icon": { "type": "string", "enum": [ "info", "help" ] },
        "text": { "type": "string" },
        "href": { "type": "string", "format": "uri" }
      },
      "additionalProperties": false,
      "required": [ "type", "icon", "text" ]
    },

    "nav": {
      "description": "Links to another resource",
      "type": "object",
      "id": "#/nav",
      "properties": {
        "type": { "type": "string", "enum": [ "nav" ] },
        "text": { "type": "string" },
        "href": { "type": "string", "format": "uri" }
      },
      "additionalProperties": false,
      "required": [ "type", "text", "href" ]
    },

    "list": {
      "description": "A list of text, default is style bullet",
      "type": "object",
      "id": "#/list",
      "properties": {
        "type": { "type": "string", "enum": [ "list" ] },
        "style": { "type": "string", "enum": [ "bullet", "numeric", "alpha" ] },
        "title": { "type": "string" },
        "items": {
          "type": "array",
          "minItems": 1,
          "items": { "$ref": "#/text" }
        }
      },
      "additionalProperties": false,
      "required": [ "type", "items" ]
    },

    "image": {
      "description": "An image",
      "type": "object",
      "id": "#/image",
      "properties": {
        "type": { "type": "string", "enum": [ "image" ] },
        "href": { "type": "string", "format": "uri" }
      },
      "additionalProperties": false,
      "required": [ "type", "href" ]
    },

    "break": {
      "description": "Thematic break",
      "type": "object",
      "id": "#/break",
      "properties": {
        "type": { "type": "string", "enum": [ "break" ] }
      },
      "additionalProperties": false,
      "required": [ "type" ]
    },

    "sms": {
      "description": "SMS with telephone number and body. If `tele` is empty, the receiver is be the current terminal.",
      "type": "object",
      "id": "#/sms",
      "properties": {
        "type": { "type": "string", "enum": [ "sms" ] },
        "tele": { "type": "string" },
        "body": { "type": "string" },
        "text": { "type": "string" }
      },
      "additionalProperties": false,
      "required": [ "type", "body", "text" ]
    },

    "call": {
      "description": "Call.",
      "type": "object",
      "id": "#/call",
      "properties": {
        "type": { "type": "string", "enum": [ "call" ] },
        "tele": { "type": "string" },
        "text": { "type": "string" }
      },
      "additionalProperties": false,
      "required": [ "type", "tele", "text" ]
    },

    "contacts": {
      "description": "Placeholder for contacts, the client is responsible for displaying relevant contacts",
      "type": "object",
      "id": "#/contacts",
      "properties": {
        "type": { "type": "string", "enum": [ "contacts" ] }
      },
      "additionalProperties": false,
      "required": [ "type" ]
    }        

  }
}

